export default {
  hr: {
    info: [
      'Otok Pag jedan od najvećih Jadranskih otoka: sa 285 km 2 peti po veličini, a sa 270 km razvedene obale otok je s najduljom obalnom linijom na Jadranu, prepunom zaljeva, uvalica, rtova i plaža',
      'Pag je jedinstven po vegetacijskom habitatu u kojemu stabla gotovo da i nema',
      'Pag je najveće carstvo kamenjara na Jadranu ispresijecano dugim suhozidima , u kojemu raste tanka trava, nisko aromatično bilje, kadulja i smilje. Upravo to aromatično bilje je osnova u prehrani paških ovaca na kamenjaru, i ono daje poseban okus poznatom paškom siru'
    ]
  },
  en: {
    info: [
      'Novalja is a tourist center of Island of Pag. Well known resort town and destination of many tourist, offers possibilities of active and meaningful vacation',
      'Novalja has a long an abundant history, there are many ancient & unique remains of that past. One of the best known is ancient Aqueduct from the 1st century',
      'Dan 13. lipnja - blagdan Sv. Antona, koji se ujedno slavi kao Dan grada Novalje, smatra se i početkom Novaljskog kulturnog ljeta u sklopu kojeg se organiziraju brojni kulturno-umjetnički i zabavni sadržaji'
    ]
  },
  cs: {
    info: [
      'Ostrov Pag je jeden z největších Jaderských ostrov: s 285 km2 pátý podle velikosti, a s 270 km členitého pobřeží je ostrov s nejdelší pobřežní čárou na Jadranu, přeplněnou zálivy, zátokami, mysy a plážemi',
      'Ostrov je mimořádný svou vegetační lokalitou v které téměř nejsou stromy',
      'Pag největší říše skaliska zpřetínané dlouhými kamennými zdmi zděnými na sucho, ve kterém roste tenká tráva, nízké aromatické rostliny, šalvěj lékařská a smil. Právě ty aromatické rostliny jsou základem stravování pažských ovcí na skalisku a ty dávají zvláštní chuť známém pažském sýru'
    ]
  },
  de: {
    info: [
      'Pag ist eine der größten Inseln im Adriatischen Meer: die Fläche beträgt 285 km2 und die Länge der Küste, die reich an Buchten, Stränden und Kaps ist, ist 270 km lang. Die größte Bucht dieser Insel ist ein Kiesstrand, der 27 km lang ist',
      'Die Insel Pag ist wegen ihrer spezifischen Flora, die fast ohne Bäume ist, als einzigartig bekannt',
      'Diese Insel ist auch reich an Steinen, wo feines Gras zusammen mit aromatischen Pflanzen, Salbei und Strohblumen wächst. Diese Pflanzen sind das einzige Nahrungsmittel für Schafe und das gibt dem berühmten Käse von Pag - Paški sir- einen spezifischen Geschmack'
    ]
  },
  it: {
    info: [
      'L’ isola di Pago e una delle piu grandi isole dell’ Adriatico; con 285 m2 di superficie, e la quinta piu grande, e con 270 km di costa articolata, e l’ isola con la piu lunga riva nell’ Adriatico, ricca d’ insenature, golfi, punte e spiagge. La piu grande insenatura di Pag, Paška uvala, e circondata da 27 km di spiagge ghiaiose',
      'Pag e un’ isola singolare per la sua vegetazione, nella quale gli alberi sono rarissimi',
      'Il piu gran regno di petraia dell’ Adriatico e intessuto dai lunghi muri a secco, dove cresce erba sottile, basse piante aromatiche, salvia e perpetuino. Proprio queste erbe aromatiche, che sono dieta base per le pecore nella petraia, donano quello speciale gusto al famoso formaggio di Pag'
    ]
  },
  sl: {
    info: [
      'Otok Pag je eden največjih otokov v Jadranskem morju: otok je s svojimi 285 km peti po vrsti po velikosti, in s 270 km dolge obale predstavlja najdaljšo obalno linijo na Jadranu. Obalo krasi veliko plaž, zalivčkov in ratov',
      'Otok Pag je edinstven po svojem vegetacijskem habitatu v katerem drevje skoraj ne obstaja',
      'Pag je največje kraljestvo kamnitnega sveta na Jadranski obali, ki je presekano z dolgimi suhozidi, ki so obraščeni s tenko travo in z nizkimi aromatičnimi rastlinami, kot sta kadulja in smilj. Ravno te aromatične rastline so osnova za prehranjevanje paških ovc, kar daje poseben in čudovit okus znanem paškem siru'
    ]
  }
}
